import * as React from 'react'
import About from './About.js'
import { Navbar, Nav} from 'react-bootstrap';
import {useState} from 'react'
import Notes from './Notes.js'

function Main()
{
    const [currentPage, SetCurrentPage] = useState(1);

    if (currentPage == 1)
    {
        return (
            <>
                <Navbar bg = "dark" variant = "dark">
                    <Navbar.Brand>
                        Sib찾
                    </Navbar.Brand>
                    <Nav>
                        <Nav.Link onClick = {() => {SetCurrentPage(1);}}>sobre</Nav.Link>
                        <Nav.Link onClick = {() => {SetCurrentPage(2);}}>anotac천es</Nav.Link>
                        <Nav.Link onClick = {() => {SetCurrentPage(3);}}>blog</Nav.Link>
                        <Nav.Link onClick = {() => {SetCurrentPage(4);}}>noticias</Nav.Link>
    
                    </Nav>
    
                </Navbar>
               <About/>
           </>
        );
    }
    else if (currentPage == 2)
    {
        return (
            <>
                <Navbar bg = "dark" variant = "dark">
                    <Navbar.Brand>
                        Sib찾
                    </Navbar.Brand>
                    <Nav>
                        <Nav.Link onClick = {() => {SetCurrentPage(1);}}>sobre</Nav.Link>
                        <Nav.Link onClick = {() => {SetCurrentPage(2);}}>anotac천es</Nav.Link>
                        <Nav.Link onClick = {() => {SetCurrentPage(3);}}>blog</Nav.Link>
                        <Nav.Link onClick = {() => {SetCurrentPage(4);}}>noticias</Nav.Link>
                    </Nav>
                </Navbar>
                <Notes/>
           </>
        );
    } 
}

export default Main
